import React from 'react'

const Benefits = props => {
  const { icon, description } = props
  return (
    <div className="column is-flex">
      <div className="columns is-multiline box is-box-shadow border-bottom-light-green is-light is-no-border-radius is-full mt-3rem">
        <div className="column is-12-desktop is-hidden-touch">
          <figure className="image is-96x96 is-img-center benefits-icon">
            <img
              className="is-rounded border-light-green"
              src={icon}
              alt={description}
            />
          </figure>
        </div>
        <figure className="column is-12-touch image is-64x64 is-img-center is-hidden-desktop">
          <img
            className="is-rounded border-light-green"
            src={icon}
            alt={description}
          />
        </figure>
        <h4 className="column is-size-6 has-text-weight-semibold mt-1rem">
          {description}
        </h4>
      </div>
    </div>
  )
}

export default Benefits
